import React from 'react'
import { useHistory } from 'react-router';
import FromToDestination from '../FromToDestinationPage/FromToDestination'
import { Route, Switch } from 'react-router-dom';
import DataTable from '../Datatable/DataTable'
import ShowTicket from '../ShowTicket/ShowTicket';
import Navbar from '../Navbar/Navbar';
import LogIn from '../LogIn/LogIn';
import { useSelector } from 'react-redux';

const BusTicketBooking = () => {
    const history = useHistory()
    const signUpDetails = useSelector(state => state.busTicket.signUpDetails)
    return (
        <>


            <div className='userLogIn'><span style={{ width: '25px', height: '25px', position: 'absolute', backgroundColor: 'hotpink', right: '50px', top: '12px', borderRadius: '50%' }}></span> {signUpDetails[0]?.email ? signUpDetails[0]?.email : "user"}</div>

            <Route exact path='/'>
                <button onClick={() => history.push('/login')}>Log In</button>
                <button onClick={() => history.push('/login')} >Sign Up</button>
            </Route>
            <Route exact path='/login'>
                <LogIn />
            </Route>
            <Route exact path='/fromtodestination'>
                <FromToDestination />
            </Route>
            <Route exact path='/ticket'>
                <DataTable />
            </Route>
            <Route exact path='/showticket'>
                <ShowTicket />
            </Route>

        </>
    )
}

export default BusTicketBooking
